import React from "react";
import { Review } from "../Review/Review";

export const Reviews = ({ reviews }) => {
  if(!reviews?.length) {
    return <div> Нету отзывов </div>
  }

  return (
      <div>
        {
          reviews.map(({ user, text, rating }) => 
            <Review user={user}   
                    text={text} 
                    rating={rating}
            />
          )
        }
      </div>
  )
}
